import React from 'react';
import styles from "./Note.module.css"

const Note = () => {
    return (
        <button className={styles.wrapper}>
            <div className={styles.name_counter}>
                <div>10000000</div>
                <div>Name</div>
            </div>
            <div>Delete</div>
        </button>
    );
};

export default Note;
